import { Container,Tabs,Tab,Row,Col } from "react-bootstrap";
import { useState } from "react";
function ProjectManager()
{

    const [tabKey, setTab] = useState('Personal');
   
        return (
            <Container className="mainContainer">
                <Row>
                    <Col className="accountMenu" lg={1}>
                        <ul>
                            <li className="menuItem"><a className="menuLink" onClick={() => setTab("NProject")}> New Project </a></li>
                            <li className="menuItem"><a className="menuLink" onClick={() => setTab("Orders")}> Modify Project</a></li>
                            <li className="menuItem"><a className="menuLink" onClick={() => setTab("Payment")}> Delete Project</a></li>
                        </ul>
                    </Col>
                    <Col className="accountMenuInfo">
                        <Container>
                            <Tabs activeKey={tabKey}>
                                <Tab eventKey="Personal" >
                                  
                                </Tab>
                                <Tab eventKey="Orders" >                    </Tab>
                            </Tabs>
                        </Container>
                    </Col>
                    <Col className="accountInfo">hf</Col>
                </Row>
            </Container>
        );
    }
   


export default ProjectManager;
